import { Sorter } from "./sorter";

export const userColumns = [
  {
    title: "SlNo",
    dataIndex: "id",
    Key: "id"
  },
  {
    title: "Name",
    dataIndex: "name",
    key: "name",
    sorter: {
      compare: Sorter.DEFAULT,
      multiple: 2
    }
  },
  {
    title: "Email",
    dataIndex: "email",
    key: "email",
    sorter: {
      compare: Sorter.DEFAULT,
      multiple: 2
    }
  },
  {
      title: "Content",
      dataIndex : "body",
      key : "body"
  }

];
